import React, { useState } from "react";

function HookCounterTwo() {
  const [details, setDetails] = useState({ firstName: " ", lastName: "" });

  const submitDetails = () => {
    alert(details.firstName);
  };
  return (
    <div>
      <input
        type="text"
        value={details.firstName}
        onChange={setDetails((firstName) => details.firstName)}
      />
      <input
        type="text"
        value={details.lastName}
        onChange={setDetails((lastName) => details.lastName)}
      />

      <button type="submit" onClick={submitDetails}>
        Submit
      </button>
    </div>
  );
}

export default HookCounterTwo;
